import React from "react";
import Content from "../../Layout/Content/Content1";
import Formikform from "../../Helpers/Form";
import { useFormik } from "formik";
import { Link } from "react-router-dom";
import { Sign_Up } from "../../Redux/Slice/Auth/auth.slice";

const Users = () => {
  const formik = useFormik({
    initialValues: {
      name: "",
      mobile: "",
      password: "",
    },

    validate: (values) => {
      const errors = {};

      if (!values.name && formik.touched.name) {
        errors.name = valid_err.PANEL_NAME_ERROR;
      }

      if (!values.mobile) {
        errors.mobile = valid_err.DOMAIN_ERROR;
      }

      if (!values.password) {
        errors.password = valid_err.PORT_ERROR;
      }

      return errors;
    },
    onSubmit: async (values) => {
      const req = {
        name: "",
        mobile: "",
        password: "",
        // panel_name: values.panel_name,
        // domain: values.domain,
        // port: values.port,
        // key: values.key,
        // ip_address: values.ip_address,
        // theme_id: values.theme_id,
        // db_url: values.db_url,
        // db_name: values.db_name,
        // broker_id: state1,
        // Create_Strategy:
        //   values.Create_Strategy && values.Create_Strategy ? 1 : 0,
        // Option_chain: values.Option_chain && values.Option_chain ? 1 : 0,
        // Strategy_plan: values.Strategy_plan && values.Strategy_plan ? 1 : 0,
        // backend_rul: values.backend_rul,
      };

      // await dispatch(Add_Panel_data({ req: req, token: user_token }))
      //   .unwrap()
      //   .then((response) => {
      //     if (response.status === 409) {
      //       toast.error(response.data.msg);
      //     } else if (response.status) {
      //       toast.success(response.msg);

      //       setTimeout(() => {
      //         navigate("/super/alladmins");
      //       }, 1000);
      //     } else if (!response.status) {
      //       toast.error(response.msg);
      //     }
      //   });
    },
  });

  const fields = [
    {
      name: "name",
      label: "Name",
      type: "text",
      label_size: 12,
      col_size: 12,
    },
    {
      name: "mobile",
      label: "Mobile",
      type: "text",
      label_size: 12,
      col_size: 12,
    },
    {
      name: "password",
      label: "Password",
      type: "password",
      label_size: 12,
      col_size: 12,
    },
  ];

  return (
    <>
      <Content
        title="Sign Up User"
        col_size={7}
        responsive_col={"col-md-8 col-lg-6"}
      >
        <Formikform
          fieldtype={fields.filter((field) => !field.showWhen)}
          formik={formik}
          btn_name="Create My Account "
          btn_Class="btn btn-primary btn-block"
          additional_field={
            <>
              {formik.errors.title && (
                <div style={{ color: "red" }}>{formik.errors.title}</div>
              )}
            </>
          }
        />

        <p className="text-center my-3">
          Already have an account?
          <Link to="/">&nbsp; Sign in</Link>
        </p>
      </Content>
    </>
  );
};

export default Users;
